pragma solidity ^0.8.0;

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

pragma solidity ^0.8.0;


contract FactoryStorage {

    enum activeStatus {
        UNACTIVE,
        BRONZE,
        SILVER,
        GOLD
    }

    struct activeItems {
        uint256 id;
        address owner;
        activeStatus status;
    }

    struct ingameItems { 
        bytes32 id;
        string itemId;
        bool ingame;
    }

    struct usersStatus { 
        address user;
        activeStatus status;
    }


    bytes4 public constant ERC721_Interface = bytes4(0x80ac58cd);
    IERC20 public sqfToken;

    // From ERC721 registry assetId to Item (to avoid asset collision)
    mapping(uint256 => activeItems) public activeItem;
    mapping(uint256 => ingameItems) private ingameItem;
    mapping(uint256 => usersStatus) private userStatus;


    event Claim(address indexed receiver, string tokenId);
    event Burn(address indexed owner, string tokenId);
    event Mint(address indexed to, string tokenId);
    event AcctiveAccount(address indexed user, string status);

}

